import React from 'react';

const stockdiv = props => {
    render()
    return(
        <div className='watchlistbxs'>
            <h2 className='watchlistWords'>
                {props.name}
            </h2>
        <div className={props.name}>
            {props.price}
        </div>
            <button
                className="watchlistbtn"
                onClick={props.handleclick}
                value={props.name}
            >
                whats is worth?
            </button>
        </div>
    )
}

export default stockdiv;
